In good times and bad, what are the hallmarks of a strong company?

@nicolewalters, CEO and founder of @inheritlearning, chats with Georgene Huang and Romy Newman, co-founders of @fairygodboss, about the importance of having strong, cohesive leadership.

(Brought to you by @delltech)

What does the word “entrepreneur” mean to you? 

"The word entrepreneur means thinking outside the box. Entrepreneurs are always challenging the normal and predictable. It took me five years to figure out that the only way to build a brand today would be to alter the first-mile supply chain. I had to relearn everything as a merchant and product developer. At @saintartnewyork, if we were conforming to the traditional fashion system, we would not be able to execute our vision. We had to completely alter the business model for us to build a brand that speaks to the customer today while equally addressing sustainability head-on." 

@carolinegogolak, founder and CEO of Saint Art, offers the keys to getting your dream project off the ground. (link in bio)
